import "./contact.css";
const Contact = () => {
    return (
        <section className="contact">
            <div className="contact-wrapper">
                <div className="contact-item">
                    <div className="contact-item-icon">
                        <i className="bi bi-house-fill"></i>
                        Address:
                    </div>
                    <p className="contact-item-text">
                        Tunis-Tunisia
                    </p>
                </div>
            </div>
        </section>
    );
}

export default Contact;
